import React, { Component} from "react";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      title: 'original'
    }
  }

  componentDidMount() {
    this.fetch('/').then(
      response => response.json
    ).then(
      data => {
        this.setState(data)
      }
    )
  }

  render() { 
    console.log(this.state.title);
    return (
      <div>
        {this.state.title}
      </div>
    );
  }
}

export default App;
